import {Fighter} from "./fighter";

/**
 * Clase Pokemon
 * Representa a los luchadores del universo Pokemon
 * Hereda de la clase Fighter
 */
export class Pokemon extends Fighter {
    /**
     * Constructor
     * @param nombre nombre del luchador (heredado de Fighter)
     * @param peso peso del luchador (heredado de Fighter)
     * @param altura altura del luchador (heredada de Fighter)
     * @param phrase catching phrase del luchador (heredada de Fighter)
     * @param estadisticas estadisticas asignables al atributo "EstadisticasBasicas" del luchador (heredadas de Fighter)
     * @param tipo tipo del pokemon (hierba, electrico...)
     */
    constructor (nombre :string, peso :number, altura :number, phrase :string, estadisticas :number[], private tipo :string){
        super(nombre,peso,altura,phrase,estadisticas)
    }

    /**
     * Funcion getTipo
     * @returns tipo
     */
     public getTipo(){
        return this.tipo
    }

    /**
     * Funcion setTipo
     * @param tipo tipo a asignar
     */
    public setTipo(tipo :string){
        this.tipo = tipo
    }
}

export abstract class Fighter {
    private EstadisticasBasicas = {
        ataque : 0,
        defensa : 0,
        velocidad :0,
        hp : 0,
    }

    /**
     * Constructor
     * @param nombre nombre del luchador
     * @param peso peso del luchador
     * @param altura altura del luchador
     * @param phrase catching phrase del luchador
     * @param estadisticas estadisticas asignables al atributo "EstadisticasBasicas" del luchador
     */
    constructor (private nombre :string, private peso :number, private altura :number, private phrase :string, estadisticas :number[]){
        this.EstadisticasBasicas.ataque = estadisticas[0];
        this.EstadisticasBasicas.defensa = estadisticas[1];
        this.EstadisticasBasicas.velocidad = estadisticas[2];
        this.EstadisticasBasicas.hp = estadisticas[3];
    }

    /**
     * Funcion getNombre
     * @returns nombre
     */
    public getNombre(){
        return this.nombre
    }

    /**
     * Funcion setNombre
     * @param nombre nombre a asignar
     */
    public setNombre(nombre :string){
        this.nombre = nombre
    }

    /**
     * Funcion getPeso
     * @returns peso
     */
    public getPeso(){
        return this.peso
    }

    /**
     * Funcion setPeso
     * @param peso peso a asignar
     */
    public setPeso(peso :number){
        this.peso = peso
    }

    /**
     * Funcion getAltura
     * @returns altura
     */
    public getAltura(){
        return this.altura
    }

    /**
     * Funcion setAltura
     * @param altura altura a asignar
     */
    public setAltura(altura :number){
        this.altura = altura
    }

    /**
     * Funcion getPhrase
     * @returns phrase
     */
    public getPhrase(){
        return this.phrase
    }

    /**
     * Funcion setPhrase
     * @param phrase phrase a asignar
     */
    public setPhrase(phrase :string){
        this.phrase = phrase
    }

    /**
     * Funcion getEstadisticas
     * @returns EstadisticasBasicas
     */
    public getEstadisticas(){
        return this.EstadisticasBasicas
    }

    /**
     * Funcion setHp
     * @param hp vida a asignar
     */
    public setHp(hp :number){
        this.EstadisticasBasicas.hp = hp;
    }
}

import {Fighter} from "./fighter";

/**
 * Clase Dragonball
 * Representa a los luchadores del universo Dragon Ball
 * Hereda de la clase Fighter
 */
export class Dragonball extends Fighter {
    /**
     * Constructor
     * @param nombre nombre del luchador (heredado de Fighter)
     * @param peso peso del luchador (heredado de Fighter)
     * @param altura altura del luchador (heredada de Fighter)
     * @param phrase catching phrase del luchador (heredada de Fighter)
     * @param estadisticas estadisticas asignables al atributo "EstadisticasBasicas" del luchador (heredadas de Fighter)
     * @param raza raza del luchador (saiyan, humano, namekiano...)
     */
    constructor (nombre :string, peso :number, altura :number, phrase :string, estadisticas :number[], private raza :string){
        super(nombre,peso,altura,phrase,estadisticas)
    }

    /**
     * Funcion getRaza
     * @returns raza
     */
     public getRaza(){
        return this.raza
    }

    /**
     * Funcion setRaza
     * @param raza raza a asignar
     */
    public setRaza(raza :string){
        this.raza = raza
    }
}

import {Fighter} from "./fighter";


/**
 * Clase Dc
 * Representa a los luchadores del universo DC
 * Hereda de la clase Fighter
 */
export class Dc extends Fighter {
    /**
     * Constructor
     * @param nombre nombre del luchador (heredado de Fighter)
     * @param peso peso del luchador (heredado de Fighter)
     * @param altura altura del luchador (heredada de Fighter)
     * @param phrase catching phrase del luchador (heredada de Fighter)
     * @param estadisticas estadisticas asignables al atributo "EstadisticasBasicas" del luchador (heredadas de Fighter)
     * @param ciudad ciudad donde reside el luchador 
     */
    constructor (nombre :string, peso :number, altura :number, phrase :string, estadisticas :number[], private ciudad :string){
        super(nombre,peso,altura,phrase,estadisticas)
    }

    /**
     * Funcion getCiudad
     * @returns ciudad
     */
     public getCiudad(){
        return this.ciudad
    }

    /**
     * Funcion setCiudad
     * @param ciudad ciudad a asignar
     */
    public setCiudad(ciudad :string){
        this.ciudad = ciudad
    }
}
